import React from 'react';
import Head from 'next/head';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../static/css/index.css';
import { Container, Row, Col, Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink } from 'reactstrap';

export default class Index extends React.Component {
    constructor(props) {
        super(props);
    
        this.toggleNavbar = this.toggleNavbar.bind(this);
        this.state = {
          collapsed: true
        };
      }
    
      toggleNavbar() {
        this.setState({
          collapsed: !this.state.collapsed
        });
      }

    render() {
        return ( 
            <div className="background">
                <Navbar color="faded">
                    <Nav navbar>
                        <NavItem>
                            <NavLink href="/">Home</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="https://github.com/reecerussell">GitHub</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="#">Resume</NavLink>
                        </NavItem>
                    </Nav>
                </Navbar>
                <Container>
                    <Head>
                        <title>Reece Russell / Software Developer</title>
                    </Head>
                    <Row style={{padding: "75px 0", borderBottom: "dotted 1px #000"}}>
                        <Col md="4">
                            <img src="https://theweeklyminute.files.wordpress.com/2014/06/dsc05899.jpg" style={{position: "relative", height: 300}} />
                        </Col>
                        <Col md="8">
                            <h1 className="display-4">
                                Hi,
                            </h1>
                            <p>
                                Welcome to my portfolio, I am a software developer, based in Milton Keynes.
                            </p>
                            
                            <Row>
                                <Col sm="7">
                                    <div className="tab"></div>
                                    <p>
                                        As the moment I am engaged to ASP.NET Core microservices and exploring GO.<br />
                                        This is my first online portfolio. Feel feel to explore and tell me what you think!
                                    </p>    
                                </Col>
                                <Col sm="5">
                                    <div className="tab"></div>
                                    <p>Just a side note, I am an apprentice software developer, working at Prominent Media.</p>
                                </Col>
                            </Row>
                        </Col>
                    </Row>
                </Container>
            </div>

        )
    }
}
